import { useAmp } from 'next/amp';

import Page from '../components/page';
import Footer from '../components/footer';
import listProperty from '../components/listProperty';

export default () => {
  const isAmp = useAmp();

  return (
    <Page title="Next.js by ZEIT - The React Framework">
        <listProperty/>
        <Footer />
    </Page>
  );
};

export const config = {
  amp: true
};
